import React from 'react'
import { Stack } from '@mui/system'
import { Link } from 'react-router-dom'
const StackItem = () => {
  return (
    <>
       <Stack direction="row" spacing={2}>
         <Link to='/buy'>Buy</Link>
      </Stack>
    </>
  )
}

export default StackItem
